import React, { useContext } from 'react';
import { SalesContext } from './SalesContext';
import { Typography } from '@mui/material';

function TodayTotals() {
    const { todayTotals } = useContext(SalesContext);
    console.log("TodayTotals rendering with:", todayTotals);

    return (
        <div>
            <Typography variant="h6">Today's Totals</Typography>
            <Typography>Cash: ${todayTotals?.cash?.toFixed(2) || '0.00'}</Typography>
            <Typography>Card: ${todayTotals?.card?.toFixed(2) || '0.00'}</Typography>
        </div>
    );
}
